def maxVowels(s: str, k: int) -> int:
    lst = []
    for i in range(len(s)-k+1):
        lst.append(s[i:i+k])
    vowels = ['a','e','i','o','u']
    maxVowels = 0
    for i in lst:
        count = 0
        for j in i:
            if j in vowels:
                count += 1
        if count > maxVowels:
            maxVowels = count
    return maxVowels
s = ""
k = 113
print(maxVowels(s,k))